eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"staticRenderFns\", function() { return staticRenderFns; });\nvar render = function() {\n  var _vm = this\n  var _h = _vm.$createElement\n  var _c = _vm._self._c || _h\n  return _c(\n    \"div\",\n    { staticClass: \"content\" },\n    [\n      _c(\"multimedia-content\", [\n        _vm._v(\n          \"The rapid evolution of computer architectures has\\nalso led to an insatiable demand for new compiler technology. Almost all high-performance systems take advantage of the same two basic techniques: parallelism and memory hierarchies. Parallelism can be found at several levels: at the instruction level, where multiple operations are executed simultaneously and at the processor level, where different threads of the same application are run on different processors. Memory hierarchies are a response to the basic limitation that we can build very fast storage or very large storage, but not storage that is both fast and large.\\n      \"\n        ),\n        _c(\"h3\", [_vm._v(\"Parallelism\")]),\n        _vm._v(\n          \"\\nAll modern microprocessors exploit instruction-level parallelism. However, this parallelism can be hidden fron the programmer. Programs are written as if all instructions were executed in sequence; the hardware dynamically checks for dependencies in the sequential instruction stream and issues them in parallel when possible. In some cases, the machine includes a hardware scheduler that can change the instruction ordering to increase the parallelism in the program. Whether the hardware reorders the instructions or not, compilers can rearrange the instructions to make instruction-level parallelism more effective.\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nInstruction-level parallelism can also appear explicitly in the instruction set. VLIW (Very Long Instruction Word) machines have instructions that can issue multiple operations in parallel. The Intel IA64 is a well-known example of such an architecture. All high-performance, general-purpose microprocessors also include instructions that can operate on a vector of data at the same time. Compiler techniques have been developed to generate code automatically for such machines from sequential programs.\\n      \"\n        ),\n        _c(\"h3\", [_vm._v(\"Memory hierarchies\")]),\n        _vm._v(\n          \"\\nA memory hierarchy consists of several levels of storage with different speeds\\nand sizes, with the level closest to the processor being the fastest\\nbut smallest. The average memory-access time of a program is reduced if\\nmost of its accesses are satisfied by the faster levels of the hierarchy.\\nBoth parallelism and the existence of a memory hierarchy improve the potential\\nperformance of a machine, but they must be harnessed effectively by the compiler to deliver real performance on an application.\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nMemory hierarchies are found in all machines.\\nA processor usually has a small number of registers consisting of hundreds of bytes, several levels of caches containing kilobytes to megabytes, physical memory containing megabytes to gigabytes,\\nand finally secondary storage that contains gigabytes and beyond. Correspondingly, the speed of accesses between adjacent levels of the hierarchy can differ by two or three orders of magnitude. The performance of a system is often limited not by the speed of the processor but by the performance of the memory subsystem. While compilers traditionally focus on optimizing the processor execution, more emphasis is now placed on making the memory hierarchy more effective.\\n\\nUsing registers effectively is probably the single most important problem in optimizing a program. Unlike registers that have to be managed explicitly in software, caches and physical memories are hidden from the instruction set and are managed by hardware. It has been found that cache-management policies implemented by hardware are not effective in some cases, especially in scientific code that has large data structure  (arrays, typically). It is possible to improve the effeciveness of the memory hierarchy by changing the layout of the data, or changing the order of instruct1ons accessing the data. We can also change the layout  of code to improve the effectiveness of instruction caches.\"\n        )\n      ])\n    ],\n    1\n  )\n}\nvar staticRenderFns = []\nrender._withStripped = true\n\n\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./node_modules/vue-loader/lib/loaders/templateLoader.js?!./node_modules/vue-loader/lib/index.js?!./src/components/content/optimizations-for-computer-architectures.vue?vue&type=template&id=2f7ce6bf\n");

