eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"staticRenderFns\", function() { return staticRenderFns; });\nvar render = function() {\n  var _vm = this\n  var _h = _vm.$createElement\n  var _c = _vm._self._c || _h\n  return _c(\n    \"div\",\n    { staticClass: \"the-science-of-building-a-compiler\" },\n    [\n      _c(\"multimedia-content\", [\n        _vm._v(\n          'The term \"optimization\" in compiler design refers to the attempts\\nthat a compiler makes to produce code that is more efficient than the obvious code.\\n\"Optimization\" is thus a misnommer, since there is no way that the code\\nproduced by a compiler can be guaranteed to be as fast or faster than\\nany other code that performs the same task.\\n'\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nIn modern times, the optimization of code that a compiler performs has\\nbecome both more important and more complex. It is more complex because\\nprocessor architecture have become more complex, yielding more opportunies\\nto improve the way code executes. It is more important because massively\\nparallel computers require substantial optimization, or their performance\\nsuffers by orders of magnitude. With the likely prevalence of multicore machines\\n(computers with chips that have large numbers of processors on them),\\nall compilers will have to face the problem of\\ntaking advantage of multiprocessor machines. \\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          '\\nIt is hard, if not impossible, to build a robust compiler out of \"hacks\".\\nThus, an extensive and useful theory has been built up\\naround the problem of optimizing code.\\nThe use of a rigorous mathematical foundation allows us to show\\nthat an optimization is correct and that it produces the desirable effect\\nfor all possible inputs. \\n'\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nOn the other hand, pure theory alone is insufficient.\\nLike many real-world problems, there are no perfect answers.\\nIn fact, most of the questions that we ask in compiler optimization\\nare undecidable. One of the most important skills in compiler design\\nis the ability to formulate the right problem to solve.\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nWe need a good understanding of the behavior of programs to start\\nwith and thorough experimentation and evaluation to validate our intuitions.\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nCompiler optimizations must meet the following design objectives:\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\" \"),\n        _c(\"ul\", [\n          _c(\"li\", [\n            _vm._v(\n              \"The optimization must be correct, that is,\\npreserve the meaning of the compiled program,\"\n            )\n          ]),\n          _vm._v(\" \"),\n          _c(\"li\", [\n            _vm._v(\n              \"The optimization must improve the performance of many programs\"\n            )\n          ]),\n          _vm._v(\" \"),\n          _c(\"li\", [\n            _vm._v(\"The compilation time must be kept reasonable, and\")\n          ]),\n          _vm._v(\" \"),\n          _c(\"li\", [\n            _vm._v(\"The engineering effort required must be manageable.\")\n          ])\n        ]),\n        _vm._v(\n          \"\\nIt is impossible to overemphasize the importance of correctness.\\nIt is trivial to write a compiler that generates fast code\\nif the generated code need not be correct!\\nOptimizing compilers are so difficult to get right that we dare say\\nthat no optimizing compiler is completely error-free! \\nThus, the most important objective in writing a compiler is that it is correct. \\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nThe second goal is that the compiler must be effective in improving\\nthe performance of many input programs.\\nNormally, performance means speed of the program execution.\\nEspecially in embedded applications, we may also wish to minimize\\nthe size of the generated code.\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nAnd in the case of mobile devices, it is also desirable that\\nthe code minimizes power consumption. Typically, the same optimizations\\nthat speed up execution time also conserve power.\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nBesides performance, usability aspects such as error reporting\\nand debugging are also important.\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nThird, we meed to keep the compilation time short to support a rapid\\ndevelopment and debugging cycle. This requirement has become easier to meet\\nas machines get faster. Often, a program is first developed and debugged\\nwithout program optimizations. Not only is the compilation time reduced,\\nbut more importantly, unoptimized programs are easier to debug,\\nbecause the optimizations introduced by a compiler often obscure\\nthe relationship between the source code and the object code. \\nTurning on optimizations in the compiler sometimes exposes new problems\\nin the source program; thus testing may again be performed\\non the optimized code.\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nThe need for additional testing sometimes deters the use of optimizations\\nin applications, especially if their performance is not critical.\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nFinally, a compiler is a complex system; we must keep the system\\nsimple to assure that the engineeing and maintenance costs\\nof the compiler are manageable. There is an infinite number of program\\noptimizations that we could implement, and it takes a nontrivial\\namount of effort to create a correct and effective optimization.\\nWe must prioritize the optimizations,\\nimplementing only those that lead to the greatest benefits on source\\nprograms encountered in practice.\\n\"\n        ),\n        _c(\"br\"),\n        _vm._v(\n          \"\\nThus, in studying compilers, we learn not only how to build a compiler,\\nbut also the general methodology of solving complex and open-ended problems.\\nThe approach used in compiler development involves both theory and\\nexperimentation. We normally start by formulating the problem\\nbased on our intuitions on what the important issues are.\\n\"\n        )\n      ])\n    ],\n    1\n  )\n}\nvar staticRenderFns = []\nrender._withStripped = true\n\n\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./node_modules/vue-loader/lib/loaders/templateLoader.js?!./node_modules/vue-loader/lib/index.js?!./src/components/content/the-science-of-code-optimization.vue?vue&type=template&id=379acc62\n");

